import React from 'react'
import { useState } from 'react'
import { Fragment } from 'react'


const ReportsPage = (props) => {
    const handlePageClick = props.handlePageClick;
    
    const householdClick = (event) => { handlePageClick('households-report'); }
    const packagingClick = (event) => { handlePageClick('households-report'); }

    // HTML structure of this component
    return (
        <Fragment>
            <h3>Generate Report</h3>
            <button onClick={() => householdClick('households-report')}>
                Ingredients Report
            </button>
            <button onClick={() => packagingClick('reports')}>
                Packaging Report
            </button>
            <button onClick={() => handlePageClick()}>
                Cost Totals
            </button>
            <button onClick={() => handlePageClick()}>
                Menu Reports
            </button>
            <button onClick={() => handlePageClick()}>
                Purchasing Reports
            </button>
        </Fragment>
    );
}

export default ReportsPage;
